import ProductItem from "./ProductItem"

function ProductBlock(props){
    const {item, revoveProduct,} = props
    return(
        <div>
            {item.map(elem => <ProductItem
                                key={elem.id}
                                id={elem.id}
                                name={elem.name}
                                price={elem.price}
                                count={elem.count}
                                revoveProduct={revoveProduct}
                               
            
            />)}
        </div>
    )
}

export default ProductBlock
